    were made with permissable funds.  There was a correction to a FEC number on one
    contribution.  Lines 21(b), 21(c), 30(b) and 30(c) were corrected with this amendment
    automatically.  Year to date for 11(a)(i) and 11(a)(ii) are not correctable due
    to the software.  However, year to date for 11(d) are correct.  All transfers
    from National Committees were expended in accordance with Federal Election Committee
    guidelines.  All exempt activities were paid for with permissable funds and met
    the definition requirements.  All Federal Election Activities were paid with permissable
    funds.  Funds transferred from National Committees are deposited in a separate
    account to ensure being utilized for permissable activities.  Slate mail activities
    met the definition requirements of federal election activity which was also exempt
    and paid for with permissable funds.  Printing costs and reimburse printing costs
    were not public communications.  Media coordination did not involve public communications.
    \ Accounting services are provided by a non-employee.  The committee identification
    numbers have been corrected.  Further information regarding this report have been
    filed on Form 99.\n"
